import React from 'react'

import ChartCard from '../Chart/ChartCard'
import { Doughnut } from 'react-chartjs-2'
import ChartLegend from '../Chart/ChartLegend'

function Expenses (props) {

  const expensesData = {
    data: {
      datasets: [
        {
          data: [10943, 21098, 100987],
          backgroundColor: ['#0694a2', '#1c64f2', '#7e3af2'],
          label: 'Dataset 1',
        },
      ],
      labels: ['Coinjoin', 'Fees', 'Merchandise'],
    },
    options: {
      responsive: true,
      cutoutPercentage: 50,
    },
    legend: {
      display: false,
    },
    labels: [
      { name: 'Coinjoin', color: 'bg-blue-500' },
      { name: 'Fees', color: 'bg-teal-600' },
      { name: 'Hardware', color: 'bg-purple-600' },
    ]
  }

    return (
      <>      
          <ChartCard title="Expenses">
            <Doughnut {...expensesData} />
            <ChartLegend legends={expensesData.labels} />
          </ChartCard>
      </>
    )
}

export default Expenses
